def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    # Group triples by subject
    subject_triples = {}
    for triple in triples:
        subject_triples.setdefault(triple.subject, []).append(triple)

    # Generate sentences based on grouped triples
    sentences = []
    for subject, triples in subject_triples.items():
        for triple in triples:
            if triple.predicate == "associatedBand/associatedMusicalArtist":
                sentences.append(f"{subject} is associated with {triple.object}.")
            elif triple.predicate == "background":
                sentences.append(f"{subject} has a background as a {triple.object}.")
            # ... (Other predicate handlers as before)

    return " ".join(sentences)

